import React from 'react';
import {Link} from 'react-router-dom';
import View from './components/View';
import '../'

function Home()
{
    return(
            <>
            <div>
                

                <Link to="/add" className='add-btn'>Add User</Link>

                <View></View>


                
                
            </div>
            </>
            
    );
}
export default Home;
